# https://leetcode.com/problems/gas-station/

from typing import List

class Solution:
    def canCompleteCircuit(self, gas: List[int], cost: List[int]) -> int:
        # if sum(gas) < sum(cost):
        #     return -1
        
        # possible_starts = [(i, gas[i]-cost[i]) for i in range(len(gas)) if gas[i]>=cost[i]]
        # print(f"{possible_starts=}")
        # sorted_possible_starts = sorted(possible_starts, key=lambda x: x[1], reverse=True)
        # print(f"{sorted_possible_starts=}")
        
        # for start_idx, _ in sorted_possible_starts:
        #     tank = 0
        #     for idx in range(len(gas)):
        #         point_num = (idx + start_idx) % len(gas)
        #         tank += (gas[point_num] - cost[point_num])
        #         # print(f"{point_num=}, {tank=}")
        #         if tank < 0:
        #             break
        #     else:
        #         print(f"{start_idx=}")
        #         return start_idx
        # return -1
        
        if sum(cost) > sum(gas):
            return -1
        
        tank, start_idx = 0, 0
        for i in range(len(gas)):
          tank += gas[i] - cost[i]
          if tank < 0:
              tank = 0
              start_idx = i+1
        return start_idx
                


if __name__ == "__main__":
    assert Solution().canCompleteCircuit(gas = [1,2,3,4,5], cost = [3,4,5,1,2]) == 3
    assert Solution().canCompleteCircuit(gas = [2,3,4], cost = [3,4,3]) == -1
